import React from 'react';
import ReactPlayer from 'react-player';

const VideoQueue = ( {videoNames} ) => {

	const videoComp = (videoNames || []).map((user, i) => {
		return (
		<div>
			<ReactPlayer 
		      	url = {videoNames[i]}
		      	width = "168 px"
		      	height= "94 px"
		      	playing = "false"
		      	/>
		</div>)
	})

	return(

		<div>
			{videoComp}
		</div>
	);
}

export default VideoQueue;
